import React, { useState } from 'react';
import '../style.css/Heder.css';

function Heder() {
    const [activeTab, setActiveTab] = useState('building');

    const handleTabClick = (tab) => {
        setActiveTab(tab);
    };

    return (
        <div className="container">
            <header className="header">
                <nav className="navbar navbar-expand-lg navbar-light bg-light">
                    <button
                        className={`nav-button ${activeTab === 'building' ? 'active' : ''}`}
                        onClick={() => handleTabClick('building')}
                    >
                        Building
                    </button>
                    <button
                        className={`nav-button ${activeTab === 'residency' ? 'active' : ''}`}
                        onClick={() => {
                            console.log("Residency button clicked");
                            handleTabClick('residency');
                        }}
                    >
                        Residency
                    </button>
                    <button
                        className={`nav-button ${activeTab === 'contact' ? 'active' : ''}`}
                        onClick={() => handleTabClick('contact')}
                    >
                        Contacts
                    </button>
                </nav>
            </header>

            <main className="content">
                <div className="row">
                    <div className="col-lg-12">
                        {activeTab === 'building' && (
                            <div className="page">
                                <h1>Welcome to the Building Page</h1>
                                {/* Add content for the Building page here */}
                            </div>
                        )}
                        {activeTab === 'residency' && (
                            <div className="page">
                                <h1>Welcome to the Residency Page</h1>
                                <h4> Information about residency:</h4>
                                <p>
                                    Here we are providing the information about buildings
                                </p>
                            </div>
                        )}
                        {activeTab === 'contact' && (
                            <div className="page">
                                <h1>Welcome to the Contact Page</h1>
                                {/* Add content for the Contact page here */}
                            </div>
                        )}
                    </div>
                </div>
            </main>
        </div>
    );
}

export default Heder;
